orchestratedResponses.query:
query StoredInstrumentsSearchByAccountsV2($input: SearchAccountsV2Input!) {
  viewer {
    account {
      searchByAccountsV2(input: $input) {
        storedPaymentMethodId
        lastFourNumbers
        paymentMethodType
        accountDetails {
          account {
            billingAccountNumber
            spectrumCoreDivisionId
            __typename
          }
          lastUsed
          autopay {
            statementCode
            __typename
          }
          __typename
        }
        card {
          billingZip
          cardType
          cardholderName
          expirationDate
          __typename
        }
        eft {
          accountHolderName
          accountType
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
